import React from 'react';



function SignUp2() {
    let Gyms = fetch("https://localhost:44364/api/User/GetGym", {
        method: "GET",
        headers: {"Content-type": "application/json;charset=UTF-8",
        Accept: "*/*"}
        
    }).then(response => response.json());
    return (
        <p>{Gyms.toString()}</p>
    );
}
export default SignUp2;
